import Header from '../../src/components/Head';

const User = () => {
    const router = useRouter();
    console.log(router);
    return (
        <>
            <Header title="Oliver - Productos"/>
            <div>
                <h2>User DEtails</h2>
                <p>Uer ID: </p>
            </div>
        </>
    );
}
 
export default User;
